import React from "react";
import "./Forecast.css";

class Forecast extends React.Component {
  render() {
    const forecastIconUrl = [
      `http://openweathermap.org/img/wn/${this.state.forecastIconOneDay}.png`,
      `http://openweathermap.org/img/wn/${this.state.forecastIconTwoDay}.png`,
      `http://openweathermap.org/img/wn/${this.state.forecastIconThreeDay}.png`,
      `http://openweathermap.org/img/wn/${this.state.forecastIconFourDay}.png`,
      `http://openweathermap.org/img/wn/${this.state.forecastIconFiveDay}.png`,
    ]
    return (
      <div className="forecast__container">       
        {this.state.forecastOneDay && <div>OneDay: { this.state.forecastOneDay }°C</div>}
        {this.state.forecastTwoDay && <div>TwoDays: { this.state.forecastTwoDay }°C</div>}
        {this.state.forecastThreeDay && <div>ThreeDays: { this.state.forecastThreeDay }°C</div>}
        {this.state.forecastFourDay && <div>FourDays: { this.state.forecastFourDay }°C</div>}
        {this.state.forecastFiveDay && <div>FiveDays: { this.state.forecastFiveDay }°C</div>}
      </div>
    )
  }
}

export default Forecast;
